import React  from 'react';
import logo from './logo.svg';
import './App.css';
import Home from './Home';
import Navbar from './Navbar';
import {Swicth, Route} from 'react-router-dom';


function App() {
  return (

    <>
    <Navbar>
    <switch>
    <Route exact path='/' component={Home}></Route>
    </switch>
    </Navbar>

    </>

  );
}

export default App;
